import '../styles/Header.css';
import '../styles/Elements.css';
import { Link } from 'react-router-dom';

function Header() {
    return(
        <div>
            <input id="close-menu" class="close-menu" type="checkbox" aria-label="Close menu" role="button"/>
            <label class="close-menu-label" for="close-menu" title="close menu"></label>
                <aside class="menu white-bg">
                    <div class="main-content menu-content">
                        <h1 onclick="getElementById('close-menu').checked = false;"><Link to='/'>TechFree</Link></h1>
                        <nav>
                            <ul onclick="getElementById('close-menu').checked = false;">
                                <li><a href="#intro">Feed</a></li>
                                <li><Link to='/FAQ'>Perguntas frequentes</Link></li>
                                <li><a href="#contact">Contato</a></li>
                                <li><a href="#contact">Minha Conta</a></li>
                            </ul>
                        </nav>
                    </div>
            </aside>

            <div class="menu-spacing"></div>
        </div>
    );
}
export default Header;
